(41659, '544DD66A-FC32-4BA4-BF9D-6D5A1F6492E4', 'Love, I’m sorry that I got defensive . I sometimes feel overpowered by you. This is the part of our dynamic that feels off balance to me and that Im trying to work through with you. As I step back and consider the conversation, it was the moment when I told you my thoughts and what I wanted and you reacted by saying “are you telling me or asking me?”That made me feel agitated. Some of this is communication style….I may be overcompensating from a feeling of not being heard unless I “get big” and need to dial it back. I feel grounded and confident that having a conversation with Ilsa is the right thing for me to do right now and i am holding both my desire to nurture that relationship, while first and foremost considering our relationship. . This is not me telling you or making an ultimatum….even though it may feel different than our norm to date.  My observation is that you get defensive when you think someone is trying to tell you something ….rather than ask you something…especially men…me included.', 'David', 'Nitzan', '2022-01-21T14:10:58.970553'),
